import Reactdom from 'react-dom';
import './index.css';

let date =new Date();
var greet;
const time=date.getHours();
if(time>=12 && time<19){
  greet='Good AfterNoon';
} else if(time>19 && time<=24){
  greet='Good Night';
} else{
   greet='Good Morning';
}
const greeting={
   textAlign:'center',
   marginTop:'90px'

}

 Reactdom.render(
   <>
   <h1>{`Hello Sir, ${greet}`}</h1>
   </>, document.getElementById("root")
